import React from 'react'
import './ExpensesList.css';

const ExpensesList = props =>{
    {filteredExpenses.length === 0 ? <p>No Expenses to Display</p>:filteredExpenses.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))}

}

export default ExpensesList;
